---
# Clojure Var 対応状況
# 元データ: scripts/generate_vars_yaml.clj
#
# フィールド定義:
#   type: Clojure 本家での種別
#     special-form | function | macro | dynamic-var | var
#   status: 実装状態
#     todo | wip | partial | done | skip
#   impl_type: このプロジェクトでの実装方式
#     builtin      - core.zig の BuiltinFn
#     special_form - Analyzer の analyzeList 直接ディスパッチ
#     macro        - Analyzer の expandBuiltinMacro
#     none         - 未実装
#   layer: 実装レイヤ
#     host   - Zig でしか実装できない（VM opcode, Value 型操作等）
#     bridge - 原理的には Clojure で書けるが Zig で実装（ブートストラップ/性能）
#     pure   - 既存プリミティブの組合せで実装可能（将来 .clj 移行候補）
#   note: メモ（任意）
#
# 暫定特殊形式の検出:
#   type: function かつ impl_type: special_form → 本家では関数だが特殊形式として実装
#   type: macro   かつ impl_type: special_form → 本家ではマクロだが特殊形式として実装

vars:
  clojure_core:
    ".":
      type: special-form
      status: skip
      note: JVM固有
    case*:
      type: special-form
      status: todo
      note: case（低レベル）
      impl_type: none
